import React from "react";


export default function About() {
  return (
    <div>
        <h2>About Me</h2>
        <p>
            I am a creative at heart. I love creating all kinds of things, from websites to content to furniture. My approach is rooted in a strong foundation of psychology, which shapes my ability to understand and conect with users. 

            I am a student for life, constantly expanding my coding skills and side projects. When I am not coding, you'll find me running my own business, Plastic Flux, creating content and training.  
        </p>
    </div>
  );
}
